import React from 'react';

const Title = () => {
  return (
    <div className="title">
      <h1>Firegram</h1>
      <h2>Suas Fotos</h2>
      <p>Olá! Essa, é minha descrição! Se não postei nenhuma foto ainda, é porque eu talvez não tenha pressionado o botão abaixo :3</p>
    </div>
  )
}

export default Title;
